export default function MailForm() {
  return (
    <form className="grid mt-7" action="#" noValidate>
      <label className="text-[0.6875rem] font-bold" htmlFor="mailForm">Email address</label>
      <input type="email" name="mailForm" id="mailForm" />
      <input className="bg-[#242742] text-white" type="submit" value="Subscribe to monthly newsletter" />
    </form>
  );
}
